function Navigation() {
    return (
        <nav className="navbar navbar-expandw-lg navbar-light fixed-top py-3" id="mainNav">
            <div className="container px-4 px-lg-5">
                <a className="navbar-brand" href="#page-top">AidALL</a>

                    <ul className="nav">
                        <li className="nav-item"><a className="nav-link" href="#about">소개</a></li>
                        <li className="nav-item"><a className="nav-link" href="#vision">비전</a></li>
                        <li className="nav-item"><a className="nav-link" href="#services">서비스</a></li>
                        <li className="nav-item"><a className="nav-link" href="#portfolio">Download</a></li>
                        <li className="nav-item"><a className="nav-link" href="#contact">Contact</a></li>
                    </ul>

            </div>
        </nav>
    );
}

export default Navigation;
